import React ,{ useState } from "react"
import Adder from "./adder"


function Inter(){
    var t=0;
    function test(ind){
         t = ind;

    }
    
    return <div>
     {t===1 ? <div></div>: <Adder  key={1} id={1} Test={test} />}
    </div>
}

export default Inter
